webpackJsonp([0xde26e4aa5285],{704:function(e,a){e.exports={data:{markdownRemark:{html:'<p>A weakness is a type of mistake in software that introduces vulnerabilities within that software. The term applies to mistakes regardless of whether they occur in implementation, design, or other phases of the software development life cycle.</p>\n<p>A cluster is a set of weaknesses. They map to external groupings that are widely used and/or commonly referred in the security industry, for easier navigation and browsing within weaknesses.</p>\n<p>Each vulnerability report can be labeled with a weakness, either by the hacker at the time of report submission, or by the team at any later point in time. HackerOne adopts a subset of Common Weakness Enumeration (CWE) weaknesses for report classification.</p>\n<p>Programs can enable, disable, or hide each weakness for their program\'s submissions. Disabling or hiding certain weaknesses can prevent you from submitting vulnerability reports that exploit a weakness that is out of scope by setting weaknesses to different states.</p>\n<p>When you submit a report, you must select the type of weakness for the vulnerability you\'ve found.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-0373f.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.51315789473684%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="weakness-1"\n        title=""\n        src="/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-e7ffa.png"\n        srcset="/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-49813.png 125w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-dc8a5.png 250w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-e7ffa.png 500w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-dda24.png 750w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-c5f18.png 1000w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-22484.png 1500w,\n/static/weakness-1-43b57610a32660f43e8a31aaefe23a6b-0373f.png 1824w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nYou can filter the options by various clusters.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-4b2d0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.87089715536105%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="weakness-2"\n        title=""\n        src="/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-e7ffa.png"\n        srcset="/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-49813.png 125w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-dc8a5.png 250w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-e7ffa.png 500w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-dda24.png 750w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-c5f18.png 1000w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-22484.png 1500w,\n/static/weakness-2-b0674a281dc7e4d7f40080797c24167f-4b2d0.png 1828w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{title:"Weakness",id:"hackers/weakness",path:"/hackers/weakness.html",description:null}}},pathContext:{}}}});
